import React from 'react';
import VideoPlayer from './video.js';

function InputPage() {
  return (
    <div>
      <h1>Input Page</h1>
      <div classname="player-wrapper">
        <VideoPlayer {...videoJsOptions} />
      </div>
    </div>
  );
}

export default InputPage;
